Minibattle_v1
Map made by Carballo
Zip includes .bsp
To install extract the files in you server's maps folder.
-----------------------------------------------------------
	
The map is small.
The struggle focuses on the center where there are several obstacles, there are small tunnels that lead you towards the towers, where there is a scout and awp.
Enjoy the map, will soon get the version 2 which includes a jetpack and several other things.


